import "./App.css";
import "./bulma/css/bulma.min.css";
import NavBar from "./components/NavBar";
import WhatWeDo from "./components/WhatWeDo";
import HeroJM from "./components/Hero";
import CaseStudiesSlider from "./components/CaseStudiesSlider";
import FooterJS from "./components/Footer";
import TrustedLeadingBrands from "./components/TrustedLeadingBrands";
//import TrustedLeadingBrandsAPI from "./components/TrustedLeadingBrandsAPI";

const TrustedLeadingBrandsAPI = () => {
  const [advice, setAdvice] = useState("");

  useEffect(() => {
    const url = "https://api.adviceslip.com/advice";

    const fetchData = async () => {
      try {
        const response = await fetch(url);
        const json = await response.json();
        console.log(json.slip.advice);
        setAdvice(json.slip.advice);
      } catch (error) {
        console.log("error", error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <p>{advice}</p>
    </div>
  );
};

const App = () => {
  return (
    <div>
      <div>
        <header>
          <NavBar />
        </header>
        <body>
          <HeroJM />
          <WhatWeDo />
          <CaseStudiesSlider />
          <TrustedLeadingBrands />
          <TrustedLeadingBrandsAPI />
        </body>
        <footer>
          <FooterJS />
        </footer>
      </div>
    </div>
  );
};

export default App;
